23.	CAPACITY RELEASE PROGRAM

23.1	PURPOSE - This Section 23 sets forth the specific terms and conditions applicable to the implementation by Transporter of a Capacity Release Program on its interstate pipeline system.

23.2	(a)	Applicability - This Section 23 is applicable to any Shipper who has a Part 284 Transportation Service Agreement under Rate Schedule FT contained in this Tariff or an Acquired Capacity Agreement and who elects to release, subject to the Capacity Release Program set forth herein, all or a portion of its firm transportation rights.  Shipper shall have the right to release any portion of the firm capacity rights held under a Transportation Service Agreement or an Acquired Capacity Agreement.

(b)	Maximum Rate Ceiling.  The maximum rate ceiling does not apply to capacity release transactions with a term of one year or less if the release is to take effect on or before one year from the date Transporter receives notice of the release in accordance with Section 23.4 below.  The maximum rate ceiling also does not apply to payments or other consideration exchanged in capacity release transactions in a release to an asset manager, as defined in Section 284.8(h)(3) of the FERC's regulations, 18 C.F.R. ? 284.8(h)(3).

(c)	Rollover Prohibition.  A prearranged release of capacity of 31 days or less, except for a release to an asset manager, as defined in Section 284.8(h)(3) of the FERC's regulations, 18 C.F.R. ? 284.8(h)(3) or to a marketer participating in a state-regulated retail access program, as defined in Section 284.8(h)(4) of the FERC's regulations, 18 C.F.R. ? 284.8(h)(4), may not roll over or extend without complying with Sections 23.4 and 23.8 below.

23.3	DEFINITIONS - For purposes of this Section 23, the following definitions shall apply:

(a)	Acquired Capacity Agreement - an agreement between Transporter and the Acquiring Shipper setting forth rate(s) and the terms and conditions of service for using capacity rights acquired pursuant to this Section 23, in the form contained in Section 23.24 of the General Terms and Conditions of this Tariff, as in effect from time to time.

(b)	Acquiring Shipper - any Shipper who acquires released capacity rights from a Releasing Shipper.

(c)	Bidding Shipper - any Shipper who is qualified pursuant to Section 23.21 below, to bid for capacity posted on Transporter's Electronic Bulletin Board, including an Acquiring Shipper who is a party to a pre-arranged release.

(d)	Firm Recallable Capacity - firm capacity released subject to the Releasing Shipper's right to recall such capacity during the term and conditions of the release.

(e)	Releasing Shipper - any Shipper holding firm capacity rights under a Part 284 Transportation Service Agreement under Rate Schedule FT or an Acquired Capacity Agreement who desires to release or re-release such firm capacity rights to another Shipper pursuant to this Section 23.

(f)	Rate Default - for index-based capacity release transactions, the non-biddable rate specified in the capacity release Offer to be used for invoicing purposes when the result of the index-based formula is unavailable or cannot be computed.  If a Rate Default is not otherwise specified, the Rate Floor shall serve as the Rate Default. 

(g)	Rate Floor - for index-based capacity release transactions, the lowest rate specified in the capacity release Offer in dollars and cents that is acceptable to the Releasing Shipper.  The Rate Floor may not be less than the Transportation Service Provider's (TSP) minimum reservation rate or zero cents when there is no stated minimum reservation rate. 

23.4	NOTICE BY SHIPPER ELECTING TO RELEASE CAPACITY

A Releasing Shipper shall deliver a notice to Transporter for posting on Transporter's Electronic Bulletin Board that it elects to release firm capacity.  The notice shall be delivered to Transporter no later than 10:00 a.m. M.S.T. and shall set forth:

(a)	Releasing Shipper's legal name, contract number, and the name and title of the individual responsible for authorizing the release of capacity;

(b)	The maximum and minimum quantity of firm daily capacity which the Releasing Shipper desires to release, stated in Dth/d;

(c)	The receipt and delivery point(s) at which the Releasing Shipper will release capacity and the firm capacity to be released at each such point;

(d)	Whether capacity will be released on a firm or firm recallable and reputable (released back to)basis and, if on a firm recallable and reputable basis, the terms on which the capacity can be recalled, which terms must be objectively stated, nondiscriminatory, and applicable to all bidders; and the terms under which the recalled capacity may be reput to the Replacement Shipper.  Reput method and rights should be specified at the time of the deal.  Reput method and rights are individually negotiated between the Releasing Shipper and Replacement Shipper.

(e)	The requested effective date and the term of the release;

(f)	The applicable maximum rate, if any;

(g)	Whether the Releasing Shipper is willing to consider release for a shorter time period than that specified in (e) above, and, if so, the minimum acceptable period of release.

(h)	Whether the Releasing Shipper desires bids in dollars or as a percentage of Transporter's maximum reservation charge applicable to the capacity to be released under this Tariff as in effect from time to time;

(i)	Whether the Releasing Shipper is willing to consider releasing capacity at a rate lower than the maximum reservation charge applicable to the capacity to be released and shown on Transporter's Statement of Rates applicable to the Releasing Shipper's Transportation Service Agreement or Acquired Capacity Agreement;

(j)	Whether the Releasing Shipper wants Transporter to market its released capacity in accordance with Section 23.18 below;

(k)	The date and time the open season ends;

(l)	Any other applicable, objective, non-discriminatory conditions, including but not limited to conditions relating to bid evaluation by Transporter;

(m)	The method by which tie bids will be broken by Transporter; and,

(n)	The date and time the notice was submitted to Transporter for posting on the Electronic Bulletin Board.

(o)	Transportation Service Providers should support the function of reputting by Releasing Shippers.

(p)	Releasing Shipper may not specify an extension of the original bid period or the pre-arranged deal match period, without submitting notice of a new release, except for a release to an asset manager, as defined in Section 284.8(h)(3) of the FERC's regulations, 18 C.F.R. ? 284.8(h)(3), or to a marketer participating in a state-regulated retail access program, as defined in Section 284.8(h)(4) of the FERC's regulations, 18 C.F.R. ? 284.8(h)(4).

(q)	For purposes of bidding and awarding, maximum/minimum rates specified by the Releasing Shipper shall include the tariff reservation rate and all demand surcharges as a total number or as stated separately.

If the terms and conditions of any release of capacity are, in Transporter's judgment, operationally infeasible or inconsistent with the provisions of this Tariff as in effect from time to time, Transporter shall notify the Releasing Shipper in writing of such operational constraints which renders the release operationally infeasible.  Such operational notices will be posted on the Electronic Bulletin Board within forty-eight (48) hours of providing notice to the Releasing Shipper.

23.5	NOTICE OF PRE-ARRANGED RELEASE - The Releasing Shipper shall deliver a notice to Transporter for posting on Transporter's Electronic Bulletin Board of a pre-arranged release.  The notice shall set forth:

(a)	The Releasing Shipper's legal name, contract number, and the name and title of the individual responsible for authorizing the release of capacity;

(b)	The legal name of the Bidding Shipper who is a party to the pre-arranged release;

(c)	The firm daily capacity to be released, stated in Dth/d;

(d)	The receipt and delivery point(s) at which the Releasing Shipper will release capacity and the volume of such firm capacity to be released at each such point;

(e)	Whether capacity will be released on a firm or firm recallable basis and, if on a firm recallable basis, the objective, non-discriminatory terms on which the capacity can be recalled;

(f)	The requested effective date and the term of the release;

(g)	The reservation charge the Bidding Shipper has agreed to pay for the released capacity;

(h)	The objective, non-discriminatory evaluation process that will be utilized by Transporter in evaluating any competing bids;

(i)	Whether the rate is expressed as a percentage of Transporter's maximum reservation charge or in dollars;

(j)	The maximum reservation charge (including reservation surcharges) applicable to the capacity being released, if any;

(k)	The date and time the open season ends, if applicable;

(l)	The date and time the notice was provided to Transporter; and,

(m)	Any other applicable, objective, non-discriminatory conditions, including but not limited to conditions relating to bid evaluations by Transporter.

(n)	For purposes of bidding and awarding, maximum/minimum rates specified by the Releasing Shipper shall include the tariff reservation rate and all demand surcharges as a total number or as stated separately.

(o)	Whether or not the Bidding Shipper is an asset manager, as defined in Section 284.8(h)(3) of the FERC's regulations, 18 C.F.R. ? 284.8(h)(3).

(p)	Whether or not the Bidding Shipper is a marketer participating in a state-regulated retail access program, as defined in Section 284.8(h)(4) of the FERC's regulations, 18 C.F.R. ? 284.8(h)(4).

23.6	TERM OF RELEASED CAPACITY

(a)	The term of any release or releases of firm capacity shall not exceed the term of the Transportation Service Agreement or Acquired Capacity Agreement under which the release occurs.

(i)	For biddable releases (one (1) year or less):

(1)	Offers should be tendered by 12:00 p.m. on a Business Day;

(2)	Open season ends no later than 1:00 p.m. on a Business Day (evaluation period begins at 1:00 p.m. during which the contingency is eliminated, determination of best Bid is made, and ties are broken);

(3)	Evaluation period ends and Award posting if no match required at 2:00 p.m.;

(4)	Match or Award is communicated by 2:00 p.m.;

(5)	Match response by 2:30 p.m.;

(6)	Where match required, Award posting by 3:00 p.m.; and,

(7)	Contract issued within one hour of Award posting (with a new contract number when applicable); nomination possible beginning at next available nomination cycle for the effective date of the contract (CCT).

(ii)	For biddable releases (more than one (1) year):

(1)	Offers should be tendered by 12:00 p.m. four business days before the Award;

(2)	Open season ends no later than 1:00 p.m. on the Business Day before timely nominations are due (open season is three Business Days);

(3)	Evaluation period begins at 1:00 p.m. during which contingency is eliminated, determination of best Bid is made, and ties are broken;

(4)	Evaluation period ends and Award posting if no match required at 2:00 p.m.;

(5)	Match or Award is communicated by 2:00 p.m.;

(6)	Match response by 2:30 p.m.;

(7)	Where match required, Award posting by 3:00 p.m.; and

(8)	Contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract (CCT).

(iii)	For non-biddable releases:

(1)	Timely Cycle:

(a)	posting of pre-arranged deals not subject to bid are due by 10:30 a.m.;

(b)	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract (CCT).

(2)	Evening Cycle:

(a)	posting of pre-arranged deals not subject to bid are due by 5:00 p.m.;

(b)	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract (CCT).

(3)	Intraday 1 Cycle:

(a)	posting of pre-arranged deals not subject to bid are due by 9:00 a.m.; 

(b)	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract (CCT).

(4)	Intraday 2 Cycle:

(a)	posting of pre-arranged deals not subject to bid are due by 4:00 p.m.;

(b)	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract (CCT).

(b)	Permanent releases of capacity shall be subject to the following provisions:

(i)	Any permanent release under this Section 23 shall require the Releasing Shipper to pay an exit fee which shall be the net present value of all demand and capacity charges payable to Transporter by Releasing Shipper over the remaining life of the Applicable Transportation Service Agreement, if the accepted bid price and/or contract term of the Acquired Capacity Agreement would require Transporter to forego future revenues.  The Transporter by Releasing Shipper over the remaining life of the Applicable Transportation Service Agreement, if the accepted bid price and/or contract term of the Acquired Capacity Agreement would require Transporter to forego future revenues.  The exit fee will not apply if the accepted bid price the Acquiring Shipper is willing to pay is the maximum contract rate set forth in the Releasing Shipper's Transportation Service Agreement for the maximum contract volumes and for a term which is at least as long as the remaining unexpired term under the Releasing Shipper's contract.

(ii)	Acquiring Shipper and Transporter shall execute an Acquired Capacity Agreement prior to the commencement of service which confirms the terms of the accepted transaction for the permanent release of capacity.

(iii)	Effective with implementation of service under the newly executed Acquired Capacity Agreement, Releasing Shipper's Transportation Service Agreement shall be deemed terminated and Releasing Shipper shall have no further obligations to Transporter with respect to the released capacity.

23.7	AVAILABILITY OF RELEASED CAPACITY - Released capacity shall be made available on a nondiscriminatory basis and shall be assigned on the basis of an open season or pre-arrangement in accordance with the procedures described in Sections 23.8 and 23.10 below.

23.8	OPEN SEASON - The term of any open season to be held as a consequence of the posting of a Releasing Shipper's notice of its election to release capacity in accordance with Sections 23.4 or 23.5 hereof shall be as specified herein.  No open season shall be required for the following transactions: (1) a pre-arranged release that is for more than one year at the maximum reservation charge applicable to the rate schedule pursuant to which capacity is released under this Tariff as in effect from time to time and which meet all terms and conditions of the release posted for the Releasing Shipper; (2) a pre-arranged release for a term of thirty-one (31) days or less; (3) a release of capacity to an asset manager, as defined in Section 284.8(h)(3) of the FERC's regulations, 18 C.F.R. ? 284.8(h)(3); and (4) a release of capacity to a marketer participating in a state-regulated retail access program, as defined in Section 284.8(h)(4) of the FERC's regulations, 18 C.F.R. ? 284.8(h)(4).  With respect to a pre-arranged release which is not subject to an open season, the Releasing Shipper shall provide Transporter notice of such release as soon as possible, but not later than the first nomination, after the release transaction commences. For pre-arranged releases for a term of thirty-one (31) days or less, Releasing Shipper may not re-release such capacity to the same Acquiring Shipper until twenty-eight (28) days after the first release period has ended, unless the capacity is awarded to the Acquiring Shipper pursuant to an open season or the release qualifies as a transaction under (1), (3) or (4) identified in this paragraph above.  All other releases shall be subject to an open season requirement in accordance with the following criteria:

(a)	For releases (1) that are for a term less than one (1) calendar month, (2) that are to commence on the first day of a calendar month, and (3) that involve no Pre-arranged Acquiring Shipper, the following procedures shall apply:

The Releasing Shipper shall provide notice to Transporter, pursuant to Section 23.4 above, of the capacity it desires to release for bid.  Any such notice shall be delivered to Transporter no later than 10:00 a.m. M.S.T., whereupon Transporter shall post the request for release to the Electronic Bulletin Board by 12:00 p.m. M.S.T. the same day.  Bids may be submitted to Transporter and posted by Transporter on the Electronic Bulletin Board until 3:00 p.m. M.S.T. on the day the request for release was posted.  Within 24 hours from the time the bid is submitted to Transporter and posted on the EBB, Transporter, subject to the provisions of Section 23.10 below, will post to its Electronic Bulletin Board the accepted Acquiring Shipper and accepted bid price and term for the released capacity, if any.

(b)	For releases that are  (1) for a term less than one (1) calendar month,  (2) that are to begin after the first day of a calendar month, and (3) not involving a pre-arranged Acquiring Shipper, the following procedures shall apply:

The Releasing Shipper shall provide notice to Transporter, pursuant to Section 23.4 above, of the capacity it desires to release for bid.  Any such notice shall be delivered to Transporter no later than 10:00 a.m. M.S.T., whereupon Transporter shall post the request for release to the Electronic Bulletin Board by 12:00 p.m. M.S.T. the same day. Bids may be submitted to Transporter and posted by Transporter on the Electronic Bulletin Board until 3:00 p.m.  M.S.T. on the day the request for release was posted. Within 24 hours from the time the bid is submitted to Transporter and posted on the EBB, Transporter, subject to the provisions of Section 23.10 below, will post to its Electronic Bulletin Board the accepted Acquiring Shipper and accepted bid price and term for the released capacity, if any.

(c)	For releases that are for one (1) calendar month or longer, the following posting procedures shall apply:

The Releasing Shipper shall provide notice to Transporter, pursuant to Sections 23.4 and 23.5 above, of the capacity it desires to release for bid. Any such notice shall be delivered to Transporter no later than 12:00 a.m. C.C.T seven (7) business days prior to the day on which the release is to begin. Transporter will post all such requests for release to its Electronic Bulletin Board by 12:00 p.m. C.C.T. on the same day the notice is received.  Unless otherwise specified by the Releasing Shipper in its notice, there shall be a minimum bid period of four (4) calendar days during which bids may be submitted to Transporter and posted on Transporter's Electronic Bulletin Board.  No later than one (1) business day after the close of the applicable bid period, Transporter will notify any pre-arranged Acquiring Shipper of any competing bid. Any pre-arranged Acquiring Shipper will have until twenty-four (24) hours from receipt of such notification to match the highest bid received, pursuant to the provision of Section 23.10(c) below.  Within twenty-four (24) hours thereafter, Transporter, subject to the provisions of Section 23.10 below, shall post to its Electronic Bulletin Board the accepted Acquiring Shipper and the accepted bid price and term for the released capacity, if any.

(d)	For purposes of bidding and awarding, maximum/minimum rates specified by the Releasing Shipper shall include the tariff reservation rate and all demand surcharges as a total number or as stated separately.

23.9	BIDS FOR RELEASED CAPACITY - A bid may be submitted to Transporter by a Bidding Shipper at any time during the open season via phone, fax or electronic mail at the e-mail address reflected on Transporter's Electronic Bulletin Board.  Bids and Offers must be complete before being posted.  Only posted Bids and Offers shall be available electronically.

(a)	Each bid for released capacity must include the following:

(i)	Bidding Shipper's legal name, address, and the name and title of the individual responsible for authorizing the bid, provided, however that such information shall not be required to be posted on the Electronic Bulletin Board;

(ii)	The term of the proposed acquisition;

(iii)	The maximum reservation charge Bidding Shipper is willing to pay for the capacity;

(iv)	The delivery and receipt points;

(v) 	The volume in Dth by delivery and receipt points desired; and,

(vi)	All other information requested by the releasing Shipper in its notice of the release.

(b)	Bids may be submitted at receipt and delivery points within the posted receipt point and delivery point corridor, subject to the condition that the gas flow will be in the same direction that existed prior to the release of the capacity.  Transporter shall make available to Acquiring Shipper any requested capacity or gas flows which differ from available posted capacity if such capacity exists and is operationally feasible on the system.

(c)	Any bid received by Transporter during the open season shall be binding on the Bidding Shipper if not withdrawn prior to the close of the open season. If a Bidding Shipper withdraws a bid as provided herein, that Bidding Shipper shall not be entitled to resubmit a bid during the open season unless the bid offers the same or higher rate than that offered in the original bid.  Bids for released capacity shall be binding until written notice of withdrawal is received by Transporter.

(d)	A Bidding Shipper may not bid a reservation charge less than the minimum reservation charge nor more than the maximum reservation charge specified by this Tariff as in effect from time to time (except the maximum rate ceiling does not apply to capacity release transactions of one year or less if the release is to take effect on or before one year from the date Transporter receives notice of the release in accordance with Section 23.4 above), nor may the volume or the term of the release of such bid exceed the maximum volume or term specified by the Releasing Shipper.

(e)	If any bid contains conditions, such conditions must either be satisfied or removed prior to the close of the specified bid period.  If the contingency is not satisfied or removed by the end of the bid period, the bid will be deemed to be a non-qualifying bid.

(f)	The Releasing Shipper has the right to withdraw its Offer during the bid period, where unanticipated circumstances justify and no minimum Bid has been made.  Offers for released capacity shall be binding until written notice of withdrawal is received by Transporter.

23.10	AWARDING OF RELEASED CAPACITY - Released capacity shall be awarded pursuant to the objective, non-discriminatory evaluation methodology established by the Releasing Shipper pursuant to Sections 23.4 and 23.5 above.  If the Releasing Shipper's notice of released capacity does not specify such a bid evaluation methodology, released capacity shall be awarded by Transporter in the following manner:

(a)	If Bidding Shipper submits a bid to acquire the released capacity at the maximum reservation rate for a term of more than one year and agrees to all terms and conditions specified in the Releasing Shipper's notice of release, then the capacity shall be awarded to such Bidding Shipper, and the Releasing Shipper shall not be entitled to reject such bid.  If more than one such bid is received, the capacity shall be awarded as set forth in Section 23.10(c) hereof.  The Releasing Shipper shall not be entitled to reject any bid so selected.

(b)	If no bid is received that conforms completely to the rate(s) and all the terms and conditions specified in the Releasing Shipper's notice submitted pursuant to Sections 23.4 and 23.5 above, then the Transporter shall be responsible, within the time periods set forth in Section 23.8 above, for selecting the Bidding Shipper(s) who offer(s) the highest bid.  The highest bid shall be based on the net present value of the reservation charge and the term of service, not to exceed the unexpired term of the Releasing Shipper's Transportation Service Agreement. Transporter shall use the rate of return on equity in Transporter's then-effective rates in the net present value computation.  However, if any bid contains conditions, such conditions must either be satisfied or removed prior to the close of the specified bid period.  If the contingency is not satisfied or removed by the end of the bid period, the bid will be deemed to be a non-qualifying bid.

(c)	If there are two or more bids of equal value received which conform to the reservation charge and all the terms and conditions specified in the Releasing Shipper's notice, released capacity will be awarded by Transporter as follows:

(i)	If more than one person offers the highest rate and meets the terms and conditions of the release, released capacity will be given to the Bidder delivering the request to Transporter on the earliest day of the bid period (date received by Transporter). Bids submitted to Transporter and posted on the Electronic Bulletin Board for released capacity will be time-stamped on the Electronic Bulletin Board.

(ii)	Released capacity will be allocated by lottery among the Bidding Shippers in the event requests are received on the same day and time; provided, however, if one of the bids is submitted by a Bidding Shipper designated in a pre-arranged release under Section 23.5 above, the capacity will be allocated to that designated Bidding Shipper. The lottery will consist of asking each affected Bidding Shipper to select a number between one and one-thousand.  After each Bidding Shipper has selected a number, a random number generator will choose the winning number.  The Bidding Shipper  closest to the winning number, either over or under, will win the lottery.  In case of a tie, the procedure will be repeated.  Any such lottery will be held within three (3) business days after the close of the open season and upon no less than one (1) business days' notice.

(d)	If the bid identified in a pre-arranged release is for less than the applicable maximum rate(s) or maximum term and a better offer is received during the open season, the pre-arranged Bidding Shipper shall have the time specified in Section 23.8 above to match that offer.  If the pre-arranged Bidding Shipper fails to match the better offer, then the Bidding Shipper who presented the better offer shall become the Acquiring Shipper.

(e)	A Releasing Shipper shall retain all of the capacity under the executed Transportation Service Agreement or Acquired Capacity Agreement that is not acquired by an Acquiring Shipper as the result of an open season or a pre-arranged release.

23.11	EXECUTION OF AGREEMENTS OR AMENDMENTS - The Acquiring Shipper obtaining released capacity shall execute a Capacity Agreement with Transporter in the form set forth in Section 23.24 below which will be provided on Transporter's Electronic Bulletin Board system.  Service can begin once the Agreement on the Electronic Bulletin Board has been executed.  A formal Capacity Agreement will be sent to the Acquiring Shipper within five (5) business days of the Execution of the Capacity Agreement on the Electronic Bulletin Board. The formal Capacity Agreement shall be signed and returned to Transporter within ten (10) business days after receipt by Acquiring Shipper.

23.12	NOTICE OF COMPLETED TRANSACTIONS - Within five (5) business days after capacity has been awarded pursuant to Section 23.10 above, Transporter shall post the following information regarding each transaction on its Electronic Bulletin Board for a period of five (5) business days:

(a)	term;

(b)	reservation charge as bid;

(c)	receipt and delivery points;

(d)	volume in Dth by receipt and delivery points;

(e)	whether the capacity is firm or firm recallable;

(f)	the names of the Releasing Shipper and the Acquiring Shipper; and

(g)	whether the Acquiring Shipper is an affiliate of the Releasing Shipper or Transporter.

23.13	EFFECTIVE DATE OF RELEASE AND ACQUISITION - The effective date of the release by a Releasing Shipper and acquisition by an Acquiring Shipper shall be on the date so designated in the Acquired Capacity Agreement or Transportation Service Agreement referenced in Section 23.11 above.

23.14	NOTICE BY TRANSPORTER OF UNCOMMITTED CAPACITY - In the event Transporter determines that it has any uncommitted capacity on its system, Transporter shall post on its Electronic Bulletin Board a notice of the operationally available capacity, setting forth the same information as prescribed in Section 23.4 or Section 23.5 above, as applicable, and the capacity shall be awarded using the procedures specified by Sections 23.8 and 23.10 above; provided, however, that Transporter shall not be obligated to accept any bid for uncommitted capacity that is for less than the maximum reservation charge specified in Section 3, Part I of this Tariff as in effect from time to time.

23.15	NOTICE OF OFFER TO PURCHASE CAPACITY - In the event a party desires to purchase capacity on Transporter's system, the offering party shall submit such offer to Transporter and Transporter will promptly post such offer on the Electronic Bulletin Board for the offering party.  Transporter shall post such offer on its Electronic Bulletin Board for the time requested by the offering party, but not to exceed 30 days.  The offering party shall furnish all data for posting which it deems appropriate but at a minimum such data shall include the following:

(i)	offering party's legal name, address, and person to contact for additional information;

(ii)	the term of the proposed purchase;

(iii)	the maximum reservation charge the party is willing to pay for the capacity;

(iv)	the volume desired by receipt and delivery points; and

(v)	the receipt and delivery points.

23.16	RATES - The reservation charge for any released firm capacity shall be the reservation charge bid by the Acquiring Shipper, but in no event shall such reservation charge be less than Transporter's minimum or more than Transporter's maximum reservation charge under the applicable rate schedule as in effect from time to time (except the maximum rate ceiling does not apply to capacity release transactions of one year or less).  In addition, Acquiring Shipper shall pay the maximum usage charge as well as all other applicable charges and surcharges for the service applicable to the usage charge.

23.17	INDEX-BASED CAPACITY RELEASE TRANSACTIONS

(a)	For index-based capacity release transactions, the Releasing Shipper shall specify which one of the following methods is acceptable for bidding on a given index-based capacity release Offer:

? a percentage of the formula, 
? a dollars and cents differential from the formula, 
? a dollars and cents differential from the Rate Floor, or 
? an approved methodology in Transporter's Tariff, if any.

When bidding is based upon a dollars and cents differential from the Rate Floor, the invoiced rate for the Award shall be calculated as the greater of (i) the result of the formula or (ii) the Rate Floor plus the high bid's differential, both not to exceed Transporter's maximum reservation rate, if applicable. 

The Releasing Shipper may specify another method in the special terms and conditions, but the capacity release Offer may not be processed within the capacity release timeline pursuant to Section 23.6(a).

(b)	For index-based capacity release transactions, Transporter shall support a Rate Floor to be specified by the Releasing Shipper in the capacity release Offer.

(c)	Unless otherwise specified in Transporter's Tariff, for index-based capacity release transactions where the result of the award is to be applied on a monthly basis, and the formula detailed in the capacity release Award requires calculations on a daily basis, the results of such daily calculations may exceed the applicable maximum daily reservation rate or be less than the applicable minimum daily reservation rate.  However, any resulting monthly reservation rate may not exceed Transporter's maximum monthly reservation rate, as applicable, or be less than the Rate Floor specified in the capacity release Award.

If the resulting monthly reservation rate exceeds Transporter's maximum reservation rate, as applicable, Transporter's maximum reservation rate shall be used for invoicing.  If the resulting monthly reservation rate is less than the Rate Floor, the Rate Floor shall be used for invoicing.

(d)	For invoicing of volumetric index-based capacity release transactions, where the result of the formula detailed in the capacity release Award is to be applied on a daily basis, if the calculated daily rate exceeds Transporter's applicable maximum reservation rate or is less than the Rate Floor specified in the capacity release Award, Transporter's maximum reservation rate or the Rate Floor, respectively, shall apply.

(e)	Transporter shall support two non-public price index references that are representative of receipt and delivery points on its system for fixed-price transactions with next-day or next-month delivery obligations. In any event, Transporter shall support all price indices it references in its FERC Gas Tariff, or General Terms and Conditions.  In addition, Transporter shall evaluate those publicly available price index references requested by its Shippers that do not require any license(s)/subscription(s) for their use and support those that are representative of the applicable receipt and delivery points.  Further: 

(i)	The identity of all supported price index references shall be posted on Transporter's Informational Postings Web site, including the duration of the license(s)/subscription(s) for posted price index reference(s).

(ii)	Upon request of a Shipper holding capacity that can be released on Transporter's system, Transporter, in consultation with its Shippers, shall review the price index references (including publicly available price index references), and update the price index references to reflect the agreed upon results of that consultation.  All parties shall act reasonably and in good faith in the review process.  Transporter shall not unreasonably withhold agreement to such proposed changes.  Such review should occur no more frequently than annually.

(iii) 	Releasing Shippers requesting the use of price index references not supported by Transporter will be responsible for providing/maintaining adequate license(s)/subscription(s) for Transporter for such additional price index reference(s) such that Transporter is able to reasonably determine that it is adequately licensed to fulfill its business responsibilities associated with index-based capacity release transactions.  Such license(s)/subscription(s) should, at a minimum be for the term of the initial release(s) that use such index references or until such index reference becomes generally supported by Transporter as referenced above.  These price index reference(s) will then be supported by Transporter and available for index-based capacity release transactions for the duration of the license(s)/subscription(s) and their identity(ies) posted on Transporter's Informational Postings Web site. 

(iv)	Regarding subsections (ii) and (iv) above, Transporter reserves the right, in its own discretion, to review any license(s)/subscription(s) that would legally bind Transporter and to evaluate the legal propriety of same as it pertains to Transporter. Transporter may, with reasonable cause, require modification of the license(s)/subscription(s) to resolve its concerns relative to any license(s)/subscription(s) that would legally bind Transporter. 

(v)	Each party involved in an index-based release activity assumes no liability for the use of price index information by other parties to the release.  Transporters support of any price index reference does not make it responsible for ensuring that a Releasing Shipper(s) or a Replacement Shipper(s) possesses any license(s)/subscriptions(s) that may be required to use such price index reference. 

(f)	For index-based capacity release transactions, upon mutual agreement between the Releasing Shipper and Transporter, the Releasing Shipper shall provide Transporter and the Replacement Shipper with the detailed calculation of the reservation rate(s).  Except as provided below, this rate(s) will be stated on the invoice provided by Transporter to the Replacement Shipper pursuant to the capacity release Award.  The results of the Releasing Shipper's calculations shall conform to the capacity release Award and/or to Transporter's  minimum and maximum reservation rates, as applicable.

? For reservation and monthly volumetric index-based capacity release transactions, the detailed calculation shall be provided in a mutually agreed upon format no later than the second Business Day of the Month following the transportation under the release.
? For volumetric index-based capacity release transactions requiring a daily rate calculation, the detailed calculation should be provided in a report pursuant to Section 23.17(i) below.

If the report is not provided by the applicable deadline above or is deficient, Transporter will notify the Releasing Shipper to provide Transporter with a correct report within one Business Day.  Thereafter, in the absence of a conforming report, Transporter will invoice the Replacement Shipper the greater of the Rate Default specified in the capacity release Offer or the Rate Floor plus any differential specified in the capacity release Award.

Upon notification to Transporter by both the Releasing Shipper and the Replacement Shipper that prior period adjustments to the calculated reservation rates used in the invoice are appropriate, invoiced amounts can be revised subsequently, upward or downward, to conform to the capacity release Award, subject to the standards governing prior period adjustments within the NAESB WGQ Invoicing Related Standards and Section 10 of the General Terms and Conditions of this Tariff.

(g)	For index-based capacity release transactions, the rate to be used in the invoice shall be the greater of: 

? the results of the calculation of the formula from the capacity release Award (if the formula cannot be calculated, the Rate Default specified in the capacity release Offer), or
? the Rate Floor plus any differential as specified in the capacity release Award.

The rate used in the invoice shall not be greater than Transporter's maximum reservation rate, as applicable.

(h)	For index-based capacity release transactions, Transporter shall support the ability of a Releasing Shipper to specify in the capacity release Offer a non-biddable Rate Default.  The Rate Default cannot be less than the Rate Floor, if any.

(i) For volumetric index-based capacity release transactions, where the Releasing Shipper performs invoicing calculations pursuant to Section 23.17(f) above, Transporter shall provide allocated quantities to the Releasing Shipper according to a mutually agreed upon timetable.  The Releasing Shipper should have at least one Business Day to process the quantities prior to returning such invoicing information to Transporter in a tabular format.

Transporter shall provide the allocated quantities to the Releasing Shipper in a tabular file to be described by Transporter.  The first row of the file should contain the column headers and data should begin on the second row of the file.  In addition, the first column should contain the applicable Gas Day(s).

23.18	MARKETING FEE - When a Releasing Shipper requests that Transporter actively market the capacity to be released, the Releasing Shipper and Transporter shall negotiate the terms of the marketing service to be provided by Transporter and specify the marketing fee to be charged.

23.19	BILLING - Transporter shall bill the Acquiring Shipper the rate(s) specified in the Acquired Capacity Agreement or the Transportation Service Agreement as applicable under Section 23.11 above, as well as any other applicable charges to usage including any penalties.  The Acquiring Shipper shall pay the billed amounts directly to Transporter.  The Releasing Shipper shall be entitled to concurrent conditional credit for the payment of a reservation charge due from the Acquiring Shipper.

The Releasing Shipper shall also be billed a marketing fee, if applicable, pursuant to the provisions of Section 23.18 above.  An Acquiring Shipper who re-releases acquired capacity shall pay to Transporter a marketing fee, if applicable.  If an Acquiring Shipper does not make payment to Transporter of the reservation portion of the charges due as set forth in Section 10 of the General Terms and Conditions of this Tariff, Transporter shall notify the Releasing Shipper of the amount due, including all applicable late charges authorized by Section 10.5 of the General Terms and Conditions of this Tariff, and such amount shall be paid by the Releasing Shipper.  All payments received from an Acquiring Shipper shall first be applied to the reservation charge, including associated late charges on the non-payment of reservation charges, then to the usage charge, then to late charges other than those related to the non-payment of reservation charges, and then to penalties.

23.20	NOMINATIONS AND SCHEDULING - An Acquiring Shipper shall nominate and schedule natural gas for transportation service hereunder directly with Transporter in accordance with the applicable procedures set forth in the General Terms and Conditions of this Tariff as in effect from time to time.  The Releasing Shipper shall give Transporter and the Acquiring Shipper(s) notice of any recall no later than twenty-four (24) hours prior to the day on which the recall is to take effect.  The Releasing Shipper in returning recalled capacity to the Acquiring Shipper(s) shall give Transporter and such Acquiring Shipper(s) twenty-four (24) hour notice prior to the day on which the capacity is to revert to the Acquiring Shipper(s).

23.21	QUALIFICATION FOR PARTICIPATION IN THE CAPACITY RELEASE PROGRAM - Any Shipper wishing to become a Bidding Shipper must satisfy the creditworthiness requirements of Transporter's Tariff as in effect from time to time by pre-qualifying prior to submitting a bid for capacity. A Shipper cannot bid for services which exceed its qualified level of creditworthiness. Notwithstanding such qualification to participate in the open season, Transporter does not guarantee the payment of any outstanding amounts by an Acquiring Shipper.

23.22	COMPLIANCE BY ACQUIRING SHIPPER - By acquiring released capacity, an Acquiring Shipper agrees that it will comply with the terms and conditions of Transporter's certificate of public convenience and necessity authorizing this Capacity Release program and all applicable Commission orders and regulations, including Part 284 thereof. Such Acquiring Shipper also agrees to be responsible to Transporter for compliance with all terms and conditions of Transporter's Tariff as in effect from time to time, as well as the terms and conditions of the Acquired Capacity Agreement.

23.23	OBLIGATIONS OF RELEASING SHIPPER - The Releasing Shipper shall continue to be liable and responsible for all reservation charges associated with the released capacity up to the maximum reservation charge specified in such Releasing Shipper's Transportation Service Agreement or Acquired Capacity Agreement.  Re-releases by an Acquiring Shipper shall not relieve the original or any subsequent Releasing Shipper of its obligation under this section.


