27.	ELECTRONIC BULLETIN BOARD

27.1	PURPOSE - The Electronic Bulletin Board will provide the following features:

(a)	The ability for a Shipper to download a file;

(b)	A daily back-up of information displayed on the board which will be retained for Shipper review for at least three years;

(c)	A periodic purging of information on completed transactions from current files;

(d)	The display of most recent entries ahead of information posted earlier;

(e)	An on-line help and on-line search function that permits users to locate information concerning a specific transaction;

(f)	A display menu that permits Shippers to separately access notices of available capacity and FERC Order Nos. 497 and 717 compliance information; and;

(g)	The procedures for back-up, archiving and retrieval will be explained on Transporter's Electronic Bulletin Board, and amended as necessary.

(h)	System-wide notices should have a separate category for notices that are not critical.

(i)	Capacity Release historical data shall be made available on a consistent basis from the transportation service provider.  This information is available by oral or written request and is not available on the EBB.  It is available in written form from the Transporter for the FERC archival period.

3.	SHIPPER NOMINATIONS AND REQUESTS FOR CAPACITY

All nominations and requests for firm capacity shall be processed on a first-come, first-served basis and shall be submitted in the manner set forth in these General Terms and Conditions.  All parties should support a seven-days-a-week, twenty-four-hours-a-day nominations process.  It is recognized that the success of seven-days-a-week, twenty-four hours a day nominations process is dependent on the availability of affected parties' scheduling personnel on a similar basis.  Party contacts need not be at their ordinary work sites but should be available by telephone or other electronic means.

3.1	Nominations received after nomination deadline should be scheduled after the nominations received before the nomination deadline.

3.2	Nomination of Scheduled Quantities:  At the end of each Gas Day, Transporter will provide the final scheduled quantities for the just completed Gas Day.  A receiver of the end of Gas Day Scheduled Quantity document can waive Transporter's requirement to send such document.

3.3	All nominations should include shipper defined begin dates and end dates.  All nominations excluding intraday nominations should have roll-over options.  Specifically, shippers should have the ability to nominate for several days, months, or years, provided the nomination begin and end dates are within the term of shipper's contract.

3.4	Intraday Nominations:  Transporter shall allow for intraday nominations.

(a)	Intraday nominations can be used to request increases or decreases in total flow, changes to receipt points, or changes to delivery points of scheduled gas.

(b)	Intraday nominations do not roll over (i.e. intraday nominations span one Gas Day only). Intraday nominations do not replace the remainder of a standing nomination.  There is no need to re-nominate if an intraday nomination modifies an existing nomination.

3.5	Intraday Nomination Cycle:

(a)	The Timely Nomination Cycle:

(i)	On the day prior to gas flow:

1:00 p.m.	Nominations leave control of the Service Requester (SR);

1:15 p.m.	Nominations are received by the TSP (including from Title Transfer Tracking Service Providers (TTTSPs));

1:30 p.m.	TSP sends the Quick Response to the SR;

4:30 p.m.	TSP receives completed confirmations from Confirming Parties;

5:00 p.m.	SR and Point Operator receive scheduled quantities from the TSP.

(ii)	Scheduled quantities resulting from Timely Nominations should be effective at the start of the next Gas Day.

(b)	The Evening Nomination Cycle:

(i)	On the day prior to gas flow:

6:00 p.m.	Nominations leave control of the SR;

6:15 p.m.	Nominations are received by the TSP (including from TTTSPs);

6:30 p.m.	TSP sends the Quick Response to the SR;

8:30 p.m.	TSP receives completed confirmations from Confirming Parties;

9:00 p.m.	TSP provides scheduled quantities to the affected SR and Point Operator, including bumped parties (notice to bumped parties).

(ii)	Scheduled quantities resulting from Evening Nominations should be effective at the start of the next Gas Day.

(c)	The Intraday 1 Nomination Cycle:

(i)	On the current Gas Day:

10:00 a.m.	Nominations leave control of the SR;

10:15 a.m.	Nominations are received by the TSP (including from TTTSPs);

10:30 a.m.	TSP sends the Quick Response to the SR;

12:30 p.m.	TSP receives completed confirmations from Confirming Parties;

1:00 p.m.	TSP provides scheduled quantities to the affected SR and Point Operator, including bumped parties (notice to bumped parties).

(ii)	Scheduled quantities resulting from Intraday 1 Nominations should be effective at 2:00 p.m. on the current Gas Day.

(d)	The Intraday 2 Nomination Cycle:

(i)	On the current Gas Day:

2:30 p.m.	Nominations leave control of the SR;

2:45 p.m.	Nominations are received by the TSP (including from TTTSPs);

3:00 p.m.	TSP sends the Quick Response to the SR;

5:00 p.m.	TSP receives completed confirmations from Confirming Parties;

5:30 p.m.	TSP provides scheduled quantities to the affected SR and Point Operator, including bumped parties (notice to bumped parties).

(ii)	Scheduled quantities resulting from Intraday 2 Nominations should be effective at 6:00 p.m. on the current Gas Day.

(e)	The Intraday 3 Nomination Cycle:

(i)	On the current Gas Day:

7:00 p.m.	Nominations leave control of the SR;

7:15 p.m.	Nominations are received by the TSP (including from TTTSPs);

7:30 p.m.	TSP sends the Quick Response to the SR;

9:30 p.m.	TSP receives completed confirmations from Confirming Parties;

10:00 p.m.	TSP provides scheduled quantities to the affected SR and Point Operator.

(ii)	Scheduled quantities resulting from Intraday 3 Nominations should be effective at 10:00 p.m. on the current Gas Day.  Bumping is not allowed during the Intraday 3 Nomination Cycle.

(f)	Any Shipper whose scheduled quantity has been bumped by an intraday nomination shall be provided advance notice of such on Transporter's Informational Postings Web site.  Such advance notice shall inform shippers whether any penalties apply on the day Shipper's volumes are reduced.

(g)	For purposes of Sections 3.5(b), (c) (d) and (e above, the word "provides" shall mean, for transmittals pursuant to NAESB WGQ Standards 1.4.x, receipt at the designated site, and for purposes of other forms of transmittal, it shall mean post or send.
